def trunc_normal_(x, mean=0., std=1.):
  "Truncated normal initialization (approximation)"
  # From https://discuss.pytorch.org/t/implementing-truncated-normal-initializer/4778/12
  return x.normal_().fmod_(2).mul_(std).add_(mean)

def drop_path(x, drop_prob: float = 0., training: bool = False):

  if drop_prob == 0. or not training:
    return x
  keep_prob = 1 - drop_prob
  shape = (x.shape[0],) + (1,) * (x.ndim - 1)  # work with diff dim tensors, not just 2D ConvNets
  random_tensor = keep_prob + torch.rand(shape, dtype=x.dtype, device=x.device)
  random_tensor.floor_()  # binarize
  output = x.div(keep_prob) * random_tensor
  return output


class DropPath(nn.Module):
  """Drop paths (Stochastic Depth) per sample  (when applied in main path of residual blocks).
  """

  def __init__(self, drop_prob=None):
    super(DropPath, self).__init__()
    self.drop_prob = drop_prob

  def forward(self, x):
    return drop_path(x, self.drop_prob, self.training)

class TAggregate(nn.Module):
  def __init__(self, clip_length=None, embed_dim=2048, n_layers=6):
    super(TAggregate, self).__init__()
    self.clip_length = clip_length
    drop_rate = 0.
    enc_layer = nn.TransformerEncoderLayer(d_model=embed_dim, nhead=8)
    self.transformer_enc = nn.TransformerEncoder(enc_layer, num_layers=n_layers, norm=nn.LayerNorm(
      embed_dim))

    self.cls_token = nn.Parameter(torch.zeros(1, 1, embed_dim))
    self.pos_embed = nn.Parameter(torch.zeros(1, clip_length + 1, embed_dim))
    self.pos_drop = nn.Dropout(p=drop_rate)

    with torch.no_grad():
      trunc_normal_(self.pos_embed, std=.02)
      trunc_normal_(self.cls_token, std=.02)
    self.apply(self._init_weights)

  def _init_weights(self, m):
    if isinstance(m, nn.Linear):
      with torch.no_grad():
        trunc_normal_(m.weight, std=.02)
      if isinstance(m, nn.Linear) and m.bias is not None:
        nn.init.constant_(m.bias, 0)
    elif isinstance(m, nn.LayerNorm):
      nn.init.constant_(m.bias, 0)
      nn.init.constant_(m.weight, 1.0)


  def forward(self, x):
    nvids = x.shape[0] // self.clip_length
    x = x.view((nvids, self.clip_length, -1))

    cls_tokens = self.cls_token.expand(nvids, -1, -1)
    x = torch.cat((cls_tokens, x), dim=1)
    x = x + self.pos_embed

    x.transpose_(1,0)
    o = self.transformer_enc(x)

    return o[0]


class MeanAggregate(nn.Module):
  def __init__(self, sampled_frames=None, nvids=None):
    super(MeanAggregate, self).__init__()
    self.clip_length = sampled_frames
    self.nvids = nvids


  def forward(self, x):
    x = x.view((-1, self.clip_length) + x.size()[1:])
    o = x.mean(dim=1)
    return o

class Mlp(nn.Module):
    def __init__(self, in_features, hidden_features=None, out_features=None, act_layer=nn.GELU, drop=0.):
        super().__init__()
        out_features = out_features or in_features
        hidden_features = hidden_features or in_features
        self.fc1 = nn.Linear(in_features, hidden_features)
        self.act = act_layer()
        self.fc2 = nn.Linear(hidden_features, out_features)
        self.drop = nn.Dropout(drop)

    def forward(self, x):
        x = self.fc1(x)
        x = self.act(x)
        x = self.drop(x)
        x = self.fc2(x)
        x = self.drop(x)
        return x

class Attention(nn.Module):
    def __init__(self, dim, num_heads=8, qkv_bias=False, qk_scale=None, attn_drop=0., proj_drop=0.):
        super().__init__()
        self.num_heads = num_heads
        head_dim = dim // num_heads

        self.scale = qk_scale or head_dim ** -0.5

        self.qkv = nn.Linear(dim, dim * 3, bias=qkv_bias)
        self.attn_drop = nn.Dropout(attn_drop)
        self.proj = nn.Linear(dim, dim)
        self.proj_drop = nn.Dropout(proj_drop)

    def forward(self, x):
        B, N, C = x.shape
        qkv = self.qkv(x).reshape(B, N, 3, self.num_heads, C // self.num_heads).permute(2, 0, 3, 1, 4)
        q, k, v = qkv[0], qkv[1], qkv[2]

        attn = (q @ k.transpose(-2, -1)) * self.scale
        attn = attn.softmax(dim=-1)
        attn = self.attn_drop(attn)

        x = (attn @ v).transpose(1, 2).reshape(B, N, C)
        x = self.proj(x)
        x = self.proj_drop(x)
        return x

class Block(nn.Module):

    def __init__(self, dim, num_heads, mlp_ratio=4., qkv_bias=False, qk_scale=None, drop=0., attn_drop=0.,
                 drop_path=0., act_layer=nn.GELU, norm_layer=nn.LayerNorm):
        super().__init__()
        self.norm1 = norm_layer(dim)
        self.attn = Attention(
            dim, num_heads=num_heads, qkv_bias=qkv_bias, qk_scale=qk_scale, attn_drop=attn_drop, proj_drop=drop)

        self.drop_path = DropPath(drop_path) if drop_path > 0. else nn.Identity()
        self.norm2 = norm_layer(dim)
        mlp_hidden_dim = int(dim * mlp_ratio)
        self.mlp = Mlp(in_features=dim, hidden_features=mlp_hidden_dim, act_layer=act_layer, drop=drop)

    def forward(self, x):
        x = x + self.drop_path(self.attn(self.norm1(x)))
        x = x + self.drop_path(self.mlp(self.norm2(x)))
        return x

class VisionTransformer(nn.Module):
    """ Vision Transformer with support for patch or hybrid CNN input stage
    """
    def __init__(self, img_size=224, patch_size=16, in_chans=3, num_classes=1000, embed_dim=768, depth=12,
                 num_heads=12, mlp_ratio=4., qkv_bias=True, qk_scale=None,
                 representation_size=None,
                 drop_rate=0., attn_drop_rate=0.,
                 drop_path_rate=0., norm_layer=nn.LayerNorm,
                 aggregate=None):
        super().__init__()
        self.num_features = self.embed_dim = embed_dim  # num_features for consistency with other models
        self.aggregate = aggregate
        self.patch_embed = PatchEmbed(
            img_size=img_size, patch_size=patch_size, in_chans=in_chans, embed_dim=embed_dim)
        num_patches = self.patch_embed.num_patches

        self.cls_token = nn.Parameter(torch.zeros(1, 1, embed_dim))
        self.pos_embed = nn.Parameter(torch.zeros(1, num_patches + 1, embed_dim))
        self.pos_drop = nn.Dropout(p=drop_rate)

        dpr = [x.item() for x in torch.linspace(0, drop_path_rate, depth)]  # stochastic depth decay rule
        self.blocks = nn.ModuleList([
            Block(
                dim=embed_dim, num_heads=num_heads, mlp_ratio=mlp_ratio, qkv_bias=qkv_bias, qk_scale=qk_scale,
                drop=drop_rate, attn_drop=attn_drop_rate, drop_path=dpr[i], norm_layer=norm_layer)
            for i in range(depth)])
        self.norm = norm_layer(embed_dim)

        # Representation layer
        if representation_size:
            self.num_features = representation_size
            self.pre_logits = nn.Sequential(OrderedDict([
                ('fc', nn.Linear(embed_dim, representation_size)),
                ('act', nn.Tanh())
            ]))
        else:
            self.pre_logits = nn.Identity()

        # Classifier head
        self.head = nn.Linear(embed_dim, num_classes) if num_classes > 0 else nn.Identity()

        with torch.no_grad():
          trunc_normal_(self.pos_embed, std=.02)
          trunc_normal_(self.cls_token, std=.02)
        self.apply(self._init_weights)

    def _init_weights(self, m):
        if isinstance(m, nn.Linear):
            with torch.no_grad():
                trunc_normal_(m.weight, std=.02)
            if isinstance(m, nn.Linear) and m.bias is not None:
                nn.init.constant_(m.bias, 0)
        elif isinstance(m, nn.LayerNorm):
            nn.init.constant_(m.bias, 0)
            nn.init.constant_(m.weight, 1.0)

    @torch.jit.ignore
    def no_weight_decay(self):
        return {'pos_embed', 'cls_token'}

    def get_classifier(self):
        return self.head

    def reset_classifier(self, num_classes, global_pool=''):
        self.num_classes = num_classes
        self.head = nn.Linear(self.embed_dim, num_classes) if num_classes > 0 else nn.Identity()

    def forward_features(self, x):
        x = rearrange(x, 'b n c w h -> (b n) c w h')
        B = x.shape[0]
        x = self.patch_embed(x)

        cls_tokens = self.cls_token.expand(B, -1, -1)  # stole cls_tokens impl from Phil Wang, thanks
        x = torch.cat((cls_tokens, x), dim=1)
        x = x + self.pos_embed
        x = self.pos_drop(x)

        for blk in self.blocks:
            x = blk(x)

        x = self.norm(x)[:, 0]
        x = self.pre_logits(x)
        return x

    def forward(self, x):
        x = self.forward_features(x)
        if self.aggregate:
            x = self.aggregate(x)
        x = self.head(x)
        return x

def _conv_filter(state_dict, patch_size=16):
    """ convert patch embedding weight from manual patchify + linear proj to conv"""
    out_dict = {}
    for k, v in state_dict.items():
        if 'patch_embed.proj.weight' in k:
            v = v.reshape((v.shape[0], 3, patch_size, patch_size))
        out_dict[k] = v
    return out_dict

#
class PatchEmbed(nn.Module):
  """ Image to Patch Embedding
  """

  def __init__(self, img_size=224, patch_size=16, in_chans=3, embed_dim=768, norm_layer=None):
    super().__init__()
    img_size = (img_size, img_size)
    patch_size = (patch_size, patch_size)
    num_patches = (img_size[1] // patch_size[1]) * (img_size[0] // patch_size[0])
    self.img_size = img_size
    self.patch_size = patch_size
    self.num_patches = num_patches

    self.proj = nn.Conv2d(in_chans, embed_dim, kernel_size=patch_size, stride=patch_size)
    self.norm = norm_layer(embed_dim) if norm_layer else nn.Identity()

  def forward(self, x):
    B, C, H, W = x.shape
    assert H == self.img_size[0] and W == self.img_size[1],       f"Input image size ({H}*{W}) doesn't match model ({self.img_size[0]}*{self.img_size[1]})."
    x = self.proj(x).flatten(2).transpose(1, 2)
    x = self.norm(x)
    return x


def STAM_224(img_size, num_classes, frames_per_clip):

    model_kwargs = dict(
        patch_size=16, embed_dim=768, depth=12, num_heads=12, representation_size=None)
    img_size = 224
    t_layers = 6

    aggregate = TAggregate(frames_per_clip, embed_dim=768, n_layers=t_layers)

    model = VisionTransformer(img_size=img_size, num_classes=num_classes, aggregate=aggregate,
                              **model_kwargs)
    return model

class AverageMeter(object):
    """Computes and stores the average and current value"""
    def __init__(self, name, fmt=':f'):
        self.name = name
        self.fmt = fmt
        self.reset()

    def reset(self):
        self.val = 0
        self.avg = 0
        self.sum = 0
        self.count = 0

    def update(self, val, n=1):
        self.val = val
        self.sum += val * n
        self.count += n
        self.avg = self.sum / self.count

    def __str__(self):
        fmtstr = '{name} {val' + self.fmt + '} ({avg' + self.fmt + '})'
        return fmtstr.format(**self.__dict__)

def accuracy(output, target, topk=(1,)):
    """Computes the accuracy over the k top predictions for the specified values of k"""
    with torch.no_grad():
        maxk = max(topk)
        batch_size = target.size(0)

        _, pred = output.topk(maxk, 1, True, True)
        pred = pred.t()
        correct = pred.eq(target.view(1, -1).expand_as(pred))

        return [correct[:k].reshape(-1).float().sum(0) * 100. / batch_size for k in topk]

def train_epoch(model, optimizer, data_loader, loss_history, loss_func, step, epoch):
    top1 = AverageMeter('acc@1', ':6.2f')
    # top5 = AverageMeter('acc@5', ':6.2f')
    model.train()
    loader = tqdm(data_loader, desc='Loading train data')
    avg_loss = 0
    for i, (data, target) in enumerate(loader):
        optimizer.zero_grad()

        data = rearrange(data, 'b p h w c -> b p c h w').cuda(0)
        target = target.type(torch.LongTensor).cuda(0)

        pred = model(data.float())
        loss = loss_func(pred, target)
        loss.backward()
        optimizer.step()
        # prec1, prec5 = accuracy(pred, target, topk=(1, 5))
        prec1 = accuracy(pred, target, topk=(1,))
        top1.update(prec1[0].item(), pred.size(0))
        # top5.update(prec5.item(), pred.size(0))
        step += 1
        avg_loss += loss.item()
        if i % 5 == 0:
            loader.set_description(
                # 'train_loss: %.3f, acc1: %.3f, acc5: %.3f, step %d' %
                'train_loss: %.3f, acc1: %.3f, step %d' %
                # (avg_loss / (i + 1), top1.avg, top5.avg, step))
                (avg_loss / (i + 1), top1.avg, step))

            loss_history.append(loss.item())
    return step

def evaluate(model, data_loader, loss_history, loss_func, valid_acc_max, onlySaveBestAccModel):
    model.eval()
    top1 = AverageMeter('acc@1', ':6.2f')
    # top5 = AverageMeter('acc@5', ':6.2f')
    total_loss = 0
    loader = tqdm(data_loader, desc='\r')

    for i, (data, target) in enumerate(loader):
        data = rearrange(data, 'b p h w c -> b p c h w').cuda(0)

        target = target.type(torch.LongTensor).cuda(0)
        with torch.no_grad():
            pred=model(data.float())
            loss = loss_func(pred, target)
            # prec1, prec5 = accuracy(pred, target, topk=(1, 5))
            prec1 = accuracy(pred, target, topk=(1,))
            top1.update(prec1[0].item(), pred.size(0))
            # top5.update(prec5.item(), pred.size(0))

            total_loss += loss.item()
            loader.set_description(
                'val_loss:   %.3f, acc1: %.3f' %
                (total_loss / (i + 1), top1.avg))

            val_acc = top1.avg
            if (not onlySaveBestAccModel) or (onlySaveBestAccModel and valid_acc_max <= val_acc):
                if valid_acc_max <= val_acc:
                    print('Validation acc increased ({:.5f} --> {:.5f}).  Saving model ...'.format(valid_acc_max, val_acc))
                print('Epoch - ' + str(epoch))

                torch.save(
                    {
                        "model": model.state_dict(),
                        "optim": optimizer.state_dict(),
                        "epoch": epoch
                    },
                    "/scratch/aarti9/model_chkpt_"+run_identity+"_E"+str(epoch)+".pt",
                )
                valid_acc_max = val_acc

    loss_history.append(total_loss / len(data_loader))
    print('val_loss:   %.3f, acc1: %.3f' % (total_loss / len(data_loader), top1.avg))
    logger.info('val_loss:   %.3f, acc1: %.3f' % (total_loss / len(data_loader), top1.avg))

    return valid_acc_max

def get_frames(filename, n_frames=1):
    frames = []
    v_cap = cv2.VideoCapture(filename)
    v_len = int(v_cap.get(cv2.CAP_PROP_FRAME_COUNT))
    frame_list = np.linspace(0, v_len - 1, n_frames + 1, dtype=np.int16)
    frame_dims = np.array([224, 224, 3])
    for fn in range(v_len):
        success, frame = v_cap.read()
        if success is False:
            continue
        if (fn in frame_list):
            frame = cv2.cvtColor(frame, cv2.COLOR_BGR2RGB)
            frame = cv2.resize(frame, (frame_dims[0], frame_dims[1]))
            frames.append(frame)
    v_cap.release()
    return frames, v_len

class DatasetProcessing(data.Dataset):
    def __init__(self, videos_path, framespath):
        super(DatasetProcessing, self).__init__()
        video_list = []
        for root, dirs, files in os.walk(videos_path):
            for file in files:
                fullpath = os.path.join(root, file)
                if ('.mp4' in fullpath):
                    video_list.append(fullpath)
        self.video_list = np.asarray(video_list)
        self.framespath = framespath

    def __getitem__(self, index):
        video_name = self.video_list[index].split('/')[-1]
        video_name_noext = os.path.splitext(video_name)[0]
        with open(self.framespath + '/' + video_name_noext + '.pkl', 'rb') as f:
            w_list = pickle.load(f)

        return w_list[0], w_list[1]

    def __len__(self):
        return self.video_list.shape[0]

